    number: '6'
    value: "Your letter from January 11, 2007:  1.\tThe expenditures made for Fundraising
      on Schedule B were not made on behalf of specifically identified federal candidates,
      but for our federal account. 2.  The payment of $ 882.98 on Schedule B to Kinkos
      for printing was for material which did not identify a specific candidate for
      Federal office and did not promote, oppose, attack, or support a candidate for
      Federal office.    3. The payments on Schedule H4 for federal and state payroll
      taxes, health insurance, insurance, ITEMIZE: insurance, and net pay were for
      employees who did not spend 25% or more of their time on FEA or activities in
      connection with a Federal election. 4. The payments for contract labor/janitor
      were made to an individual who is not our employee.  He is a self employed individual
      who has a janitorial service and other clients and we hired him to clean our
      offices.  5. We have amended the report to show the proper allocation ratio
      on schedule H 1 and H4. Furthermore, we have repaid the overpayment to our nonfederal
      account on October 2007 and reported this in our November 2007 report.   6.
      We have amended the report to eliminate Schedule H2. 7. Payments received from
      candidates for the Presidential Election 2008 were changed from filing fees
      to offset to operating expenditures. 8. 4. The expenditures on Schedule H4  to
      Starboard Communications were for solicitation of donations for our federal
      and non-federal accounts. The material printed did not identify a specific candidate
      for Federal office and did not promote, oppose, attack, or support a candidate
      for Federal office"
